    so: "Cilmi-yariyaasha ayaa ka codsanaya inaad siiso Aqoonsigaaga fudud kalfadhiga hore, fadlan ku qor halkan, ama soo geli faylka la soo dejiyey markii kalfadhigii ugu dambeeyay uu dhammaado.",
