    ur: "محقق نے درخواست کی ہے کہ آپ پچھلے سیشن سے اپنی ایزیئس ID فراہم کرتے ہیں ، براہ کرم اسے یہاں ٹائپ کریں ، یا آخری سیشن ختم ہونے پر ڈاؤن لوڈ کردہ فائل کو اپ لوڈ کریں۔",
