    bn: '❌ অবৈধ উত্তর। মডেলের নামটি অবশ্যই "আইফোন" শুরু করতে হবে, এবং লুকানো "এ" সংখ্যাটি অবশ্যই "এ" হতে হবে এবং তারপরে চার-অঙ্কের সংখ্যা হবে।',
