    my: '❌တရားမဝင်အဖြေ။ စံပြအမည်မှာ "iPhone" ကိုစတင်ရပါမည်။ ဝှက်ထားသော "a" နံပါတ်သည် "A" ဖြစ်ရမည်။',
    be: '❌ Незаконны адказ. Назва мадэлі павінна пачынацца "iPhone", а схаваны "A" лік павінен быць "A", а затым чатырохзначны нумар.',
    km: '❌ចម្លើយខុសច្បាប់។ ឈ្មោះម៉ូដែលត្រូវតែចាប់ផ្តើម "ទូរស័ព្ទ iPhone", និងលេខ "ដែលលាក់" ដែលត្រូវបានលាក់ "a" អមដោយលេខបួនខ្ទង់។',
