    az: "Seçim düyməsini basarkən, Apple menyusuna gedin > Sistem məlumatı. Hardware Baxışdan, model adını və model identifikatorunu aşağıdakı müvafiq sahələrə köçürün.",
    eu: "Aukera tekla sakatzean, joan Apple Menura > Sistemaren informazioa. Hardwarearen ikuspegi orokorretik, kopiatu ereduaren izena eta eredu identifikatzailea beheko eremuetan.",
    bn: "বিকল্প কী টিপানোর সময়, অ্যাপল মেনুতে যান > সিস্টেমের তথ্য। হার্ডওয়্যার ওভারভিউ থেকে, নীচের সংশ্লিষ্ট ক্ষেত্রগুলিতে মডেলের নাম এবং মডেল সনাক্তকারীকে অনুলিপি করুন।",
    bg: "Докато натискате клавиша с опции, отидете в менюто на Apple > Информация за системата. От прегледа на хардуера копирайте името на модела и идентификатора на модела на съответните полета по -долу.",
    my: "Option ခလုတ်ကိုနှိပ်နေစဉ် Apple Menu > System Information သို့သွားပါ။ ဟာ့ဒ်ဝဲခြုံငုံသုံးသပ်ချက်မှမော်ဒယ်အမည်နှင့်မော်ဒယ်အမှတ်အသားကိုအောက်တွင်ဖော်ပြထားသောသက်ဆိုင်ရာအကွက်များသို့ကူးယူပါ။",
    be: "Націскаючы на ​​клавішу опцыі, перайдзіце ў меню Apple > Сістэмная інфармацыя. З агляду абсталявання скапіруйце імя мадэлі і ідэнтыфікатар мадэлі ў адпаведныя палі ніжэй.",
    km: "ខណៈពេលដែលការចុចគ្រាប់ចុចជម្រើសសូមចូលទៅកាន់ Apple Menu > ព័ត៌មានប្រព័ន្ធ។ ពីទិដ្ឋភាពផ្នែករឹងផ្នែករឹងចម្លងឈ្មោះម៉ូដែលនិងអត្តសញ្ញាណគំរូទៅនឹងវាលដែលត្រូវគ្នាខាងក្រោម។",
    ca: "Mentre premeu la tecla Opció, aneu al menú Apple > Informació del sistema. Des de la visió general del maquinari, copieu el nom del model i l’identificador del model fins als camps corresponents a continuació.",
    "zh-CN":
      "在按选项键时，请转到Apple菜单>系统信息。从硬件概述中，将模型名称和模型标识符复制到下面的相应字段。",
    "zh-HK":
      "在按選項鍵時，請轉到Apple菜單>系統信息。從硬件概述中，將模型名稱和模型標識符複製到下面的相應字段。",
    hr: "Dok pritisnete tipku Option, idite na Apple izbornik > Informacije o sustavu. Iz pregleda hardvera kopirajte naziv modela i identifikator modela u odgovarajuća polja u nastavku.",
    cs: "Při stisknutí klávesy opce přejděte do nabídky Apple > Systémové informace. Z přehledu hardwaru zkopírujte název modelu a identifikátor modelu na odpovídající pole níže.",
    da: "Når du trykker på indstillingstasten, skal du gå til Apple -menuen > Systemoplysninger. Fra hardwareoversigten skal du kopiere modelnavnet og modelidentifikatoren til de tilsvarende felter nedenfor.",
