    ta: "விருப்ப விசையை அழுத்தும்போது, ​​ஆப்பிள் மெனு > கணினி தகவலுக்குச் செல்லவும். வன்பொருள் கண்ணோட்டத்தில், மாதிரி பெயர் மற்றும் மாதிரி அடையாளங்காட்டியை கீழே உள்ள தொடர்புடைய புலங்களுக்கு நகலெடுக்கவும்.",
    te: "ఆప్షన్ కీని నొక్కేటప్పుడు, ఆపిల్ మెను > సిస్టమ్ సమాచారానికి వెళ్లండి. హార్డ్‌వేర్ అవలోకనం నుండి, మోడల్ పేరు మరియు మోడల్ ఐడెంటిఫైయర్‌ను దిగువ సంబంధిత ఫీల్డ్‌లకు కాపీ చేయండి.",
