    tr: "Seçenek tuşuna basarken Apple Menüsü > Sistem Bilgileri'ne gidin. Donanıma genel bakışından, model adını ve model tanımlayıcısını aşağıdaki ilgili alanlara kopyalayın.",
    uk: "Натиснувши клавішу клавішу опції, перейдіть до меню Apple > Системна інформація. З огляду обладнання, скопіюйте назву моделі та ідентифікатор моделі у відповідні поля нижче.",
    ur: "آپشن کلید کو دبانے کے دوران ، ایپل مینو > سسٹم کی معلومات پر جائیں۔ ہارڈ ویئر کے جائزہ سے ، ماڈل نام اور ماڈل شناخت کنندہ کو نیچے دیئے گئے فیلڈز میں کاپی کریں۔",
