    hr: 'Idite na izbornik Postavke ili Opcije, pomaknite se na dno popisa i provjerite "O telefonu", "O uređaju" ili slično. Kopirajte naziv i broj modela u odgovarajuća polja u nastavku.',
    cs: "Přejděte do nabídky Nastavení nebo možností, přejděte na spodní část seznamu a zkontrolujte „o telefonu“, „o zařízení“ nebo podobném. Zkopírujte název modelu a číslo do odpovídajících polí níže.",
    da: "Gå til menuen Indstillinger eller indstillinger, rulle til bunden af ​​listen, og kontroller 'om telefon', 'om enhed' eller lignende. Kopier modelnavnet og nummeret til de tilsvarende felter nedenfor.",
    nl: "Ga naar het menu Instellingen of Opties, blader onderaan de lijst en controleer ‘over telefoon’, ‘over apparaat’ of iets dergelijks. Kopieer de modelnaam en het nummer naar de bijbehorende velden hieronder.",
