    az: "Yalnız dönün və baxış məsafənizi tapacağıq! Soruşduqda, kameranıza giriş verin.",
    eu: "Buelta eman, eta zure ikuspegi distantzia aurkituko dugu! Galdetu duzunean, eman kamerarako sarbidea.",
