    bg: "Просто се обърнете и ние ще намерим вашето разстояние за гледане! Когато попитате, моля, предоставете достъп до вашата камера.",
    my: "လှည့်ကြည့်ပါ, တောင်းသောအခါသင်၏ကင်မရာကိုလက်လှမ်းမီပါ။",
    be: "Проста павярніцеся, і мы знойдзем вашу адлегласць прагляду! На пытанне, калі ласка, дайце доступ да вашай камеры.",
    km: "គ្រាន់តែងាកមកហើយយើងនឹងរកឃើញចម្ងាយមើលរបស់អ្នក! នៅពេលសួរសូមផ្តល់ការចូលដំណើរការកាមេរ៉ារបស់អ្នក។",
