    it: "Girati e troveremo la tua distanza di visione! Alla domanda, si prega di concedere l'accesso alla fotocamera.",
    ja: "振り向くだけで、視聴距離が見つかります！尋ねられたら、カメラへのアクセスを許可してください。",
    jw: "Mung muter, lan kita bakal nemokake jarak tampilan! Nalika dijaluk, mangga diwenehi akses menyang kamera.",
    kn: "ತಿರುಗಿ, ಮತ್ತು ನಿಮ್ಮ ವೀಕ್ಷಣೆಯ ದೂರವನ್ನು ನಾವು ಕಾಣುತ್ತೇವೆ! ಕೇಳಿದಾಗ, ದಯವಿಟ್ಟು ನಿಮ್ಮ ಕ್ಯಾಮೆರಾಗೆ ಪ್ರವೇಶವನ್ನು ನೀಡಿ.",
    kk: "Тек айналаңызда бұрылыңыз, және біз сіздің көру қашықтығыңызды табамыз! Сұралған кезде камераңызға қол жеткізіңіз.",
    ky: "Жөн гана бурулуп, биз сиздин көрүүңүздү алыстатабыз! Сураганда, камераңызга мүмкүнчүлүк бериңиз.",
    ko: "그냥 돌아 서면 시청 거리를 찾을 수 있습니다! 요청하면 카메라에 액세스 할 수 있습니다.",
    lo: "ພຽງແຕ່ຫັນມາ, ແລະພວກເຮົາຈະຊອກຫາໄລຍະທາງທີ່ທ່ານເບິ່ງ! ເມື່ອຖືກຖາມ, ກະລຸນາໃຫ້ການເຂົ້າເຖິງກ້ອງຖ່າຍຮູບຂອງທ່ານ.",
    lv: "Vienkārši pagriezieties, un mēs atradīsim jūsu skatu attālumu! Kad jums jautā, lūdzu, piešķiriet piekļuvi savai kamerai.",
    lt: "Tiesiog apsisukite, ir mes rasime jūsų peržiūros atstumą! Paklausus, prašome suteikti prieigą prie jūsų fotoaparato.",
    mk: "Само свртете се, и ќе го најдеме вашето растојание за гледање! На прашањето, ве молиме дајте пристап до вашата камера.",
    mg: "Mihodina fotsiny, ary ho hitantsika ny halaviran-tsainao! Rehefa nanontaniana ianao dia azafady ny fidirana amin'ny fakantsarinao.",
    ms: "Hanya berpaling, dan kami akan menemui jarak tontonan anda! Apabila ditanya, sila berikan akses ke kamera anda.",
    ml: "തിരിഞ്ഞുനോക്കുക, നിങ്ങളുടെ കാഴ്ചപ്പാട് ഞങ്ങൾ കണ്ടെത്തും! ചോദിച്ചപ്പോൾ, നിങ്ങളുടെ ക്യാമറയിലേക്ക് പ്രവേശനം നൽകുക.",
    mt: "Dawwar biss, u nsibu d-distanza tal-vista tiegħek! Meta mistoqsi, jekk jogħġbok agħti aċċess għall-kamera tiegħek.",
    mr: "फक्त फिरवा, आणि आम्ही आपले दृश्य अंतर शोधू! विचारले असता, कृपया आपल्या कॅमेर्‍यावर प्रवेश द्या.",
    mo: "Pur și simplu întoarceți -vă și vă vom găsi distanța de vizionare! Când ați solicitat, vă rugăm să acordați acces la camera dvs.",
    mn: "Зүгээр л эргэж, бид таны харах зайг олох болно! Хэзээ асуух вэ, камераа хүртээмжтэй хандана уу.",
    ne: "केवल चारै तिर घुम्नुहोस्, र हामी तपाईंको अवधारणा दूरी भेट्टाउनेछौं! जब सोधिन्छ, कृपया तपाईंको क्यामेराको पहुँच प्रदान गर्नुहोस्।",
    no: "Bare snu deg, så finner vi visningsavstanden din! Gi tilgang til kameraet ditt når du blir spurt.",
    yi: "נאָר קער אַרום, און מיר וועלן געפֿינען דיין וויוינג ווייַטקייט! ווען געפרעגט, ביטע שענקען אַקסעס צו דיין אַפּאַראַט.",
    fa: "فقط به دور خود بپیچید ، و فاصله مشاهده شما را پیدا خواهیم کرد! وقتی از وی سؤال شد ، لطفاً به دوربین خود دسترسی پیدا کنید.",
