    sk: "⚠ Pretože táto štúdia bude kalibrovať mikrofóny (_CalibratesoundMicrophonesBOOL == TRUE), na kalibráciu svojich reproduktorov budete potrebovať mikrofón USB (MinIDSP UMIK-1 alebo UMIK-2).",
