    hy: "Եթե ​​ունեք սմարթֆոն, մատնանշեք ձեր հեռախոսի տեսախցիկը հետեւյալ QR կոդով (սեւ եւ սպիտակ ստուգումներ) եւ կտտացրեք այն ձեր հեռախոսի էկրանին:",
    az: "Bir smartfon varsa, telefonunuzun kamerasını aşağıdakı QR kodunda (qara və ağ çeklərdə) işarələyin və telefonunuzun ekranında vurun.",
    eu: "Smartphone bat baduzu, seinalatu telefono kamera hurrengo QR kodean (zuri-beltzeko txekeak) eta egin klik gainean zure telefonoko pantailan.",
