    bg: "Ако имате смартфон, насочете телефона си на следния QR код (черно -бели проверки) и кликнете върху него на екрана на телефона си.",
    my: "သင့်တွင်စမတ်ဖုန်းရှိပါကသင်၏ဖုန်းကင်မရာကိုအောက်ပါ QR Code (အနက်ရောင်နှင့်အဖြူရောင်စစ်ဆေးမှုများ) တွင်အမှတ်အသားပြုပါ။ သင်၏ဖုန်းမျက်နှာပြင်တွင်၎င်းကိုနှိပ်ပါ။",
    be: "Калі ў вас ёсць смартфон, націсніце камеру тэлефона на наступны QR -код (чорна -белыя чэкі) і націсніце на яго на экране тэлефона.",
    km: "ប្រសិនបើអ្នកមានស្មាតហ្វូនសូមចុចកាមេរ៉ាទូរស័ព្ទរបស់អ្នកនៅលេខកូដ QR ខាងក្រោម (សញ្ញាខ្មៅនិងស) ហើយចុចលើអេក្រង់របស់ទូរស័ព្ទអ្នក។",
    ca: "Si teniu un telèfon intel·ligent, apunteu la càmera del telèfon al següent codi QR (comprovacions en blanc i negre) i feu clic a la pantalla del telèfon.",
    "zh-CN":
      "如果您有智能手机，请将手机摄像机指向以下QR码（黑白检查），然后在手机的屏幕上单击它。",
    "zh-HK":
      "如果您有智能手機，請將手機攝像機指向以下QR碼（黑白檢查），然後在手機的屏幕上單擊它。",
