    gu: "જો તમારી પાસે સ્માર્ટફોન છે, તો તમારા ફોન કેમેરાને નીચેના ક્યૂઆર કોડ (બ્લેક અને વ્હાઇટ ચેક) પર નિર્દેશ કરો અને તમારા ફોનની સ્ક્રીનમાં તેના પર ક્લિક કરો.",
    he: "אם יש לך סמארטפון, הצב את מצלמת הטלפון שלך בקוד ה- QR הבא (צ'קים בשחור לבן) ולחץ עליו במסך הטלפון שלך.",
