    hu: "Ha van okostelefonja, mutassa meg a telefonkameráját a következő QR -kódra (fekete -fehér csekkek), és kattintson rá a telefon képernyőjén.",
    is: "Ef þú ert með snjallsíma skaltu benda á myndavél símans á eftirfarandi QR kóða (svart og hvítt ávísanir) og smelltu á hana á skjá símans.",
    id: "Jika Anda memiliki smartphone, arahkan kamera ponsel Anda pada kode QR berikut (cek hitam dan putih), dan klik di layar ponsel Anda.",
