    kn: "ನೀವು ಸ್ಮಾರ್ಟ್‌ಫೋನ್ ಹೊಂದಿದ್ದರೆ, ನಿಮ್ಮ ಫೋನ್ ಕ್ಯಾಮೆರಾವನ್ನು ಈ ಕೆಳಗಿನ ಕ್ಯೂಆರ್ ಕೋಡ್‌ನಲ್ಲಿ (ಕಪ್ಪು ಮತ್ತು ಬಿಳಿ ಚೆಕ್) ತೋರಿಸಿ, ಮತ್ತು ನಿಮ್ಮ ಫೋನ್‌ನ ಪರದೆಯಲ್ಲಿ ಅದರ ಮೇಲೆ ಕ್ಲಿಕ್ ಮಾಡಿ.",
    kk: "Егер сізде смартфон болса, телефон камерасын келесі QR коды (қара және ақ чектер) тармағында көрсетіп, телефонның экранында нұқыңыз.",
    ky: "Эгерде сизде смартфонуңуз болсо, төмөнкү QR кодунда телефон камераңызды белгилеңиз (кара жана ак текшерүүлөр), жана телефонуңуздун экранына чыкылдатыңыз.",
    ko: "스마트 폰이있는 경우 다음 QR 코드 (흑백 체크)로 전화 카메라를 가리키고 휴대 전화 화면에서 클릭하십시오.",
    lo: "ຖ້າທ່ານມີໂທລະສັບສະຫຼາດ, ໃຫ້ຊີ້ກ້ອງໂທລະສັບຂອງທ່ານຢູ່ QR Code (ສີດໍາແລະສີຂາວ), ແລະກົດທີ່ຫນ້າຈໍຂອງໂທລະສັບຂອງທ່ານ.",
    lv: "Ja jums ir viedtālrunis, norādiet tālruņa kameru pie šāda QR koda (melnbalti čeki) un noklikšķiniet uz tā tālruņa ekrānā.",
    lt: "Jei turite išmanųjį telefoną, nukreipkite savo telefono fotoaparatą į šį QR kodą (nespalvotai čekiai) ir spustelėkite jį savo telefono ekrane.",
    mk: "Ако имате паметен телефон, насочете ја вашата телефонска камера на следниот QR код (црно -бели проверки) и кликнете на неа на екранот на вашиот телефон.",
