    mt: "Jekk għandek smartphone, indika l-kamera tat-telefon tiegħek fil-kodiċi QR li ġej (kontrolli iswed u abjad), u kklikkja fuqu fl-iskrin tat-telefon tiegħek.",
    mr: "आपल्याकडे स्मार्टफोन असल्यास, आपला फोन कॅमेरा खालील क्यूआर कोडवर (ब्लॅक अँड व्हाइट चेक) निर्देशित करा आणि आपल्या फोनच्या स्क्रीनवर त्यावर क्लिक करा.",
    mo: "Dacă aveți un smartphone, îndreptați -vă camera de telefon către următorul cod QR (verificări alb -negru) și faceți clic pe el în ecranul telefonului.",
