    ne: "यदि तपाईंसँग स्मार्टफोन छ भने, निम्न QR र सेतो जाँचहरूमा तपाईंको फोन क्यामेरा औंल्याउनुहोस् (कालो र सेतो चेक), र यसमा तपाईंको फोनको स्क्रिनमा क्लिक गर्नुहोस्।",
