    yi: "אויב איר האָט אַ סמאַרטפאָנע, פונט דיין טעלעפאָן אַפּאַראַט אין די פאלגענדע QR קאָד (שוואַרץ און ווייַס טשעקס), און גיט עס אין דיין טעלעפאָן פאַרשטעלן.",
    fa: "اگر تلفن هوشمند دارید ، دوربین تلفن خود را در کد QR زیر (چک های سیاه و سفید) قرار دهید و در صفحه تلفن خود روی آن کلیک کنید.",
    pl: "Jeśli masz smartfon, skieruj aparat telefoniczny na następujący kod QR (czarno -białe czeki) i kliknij go na ekranie telefonu.",
