    pa: "ਜੇ ਤੁਹਾਡੇ ਕੋਲ ਸਮਾਰਟਫੋਨ ਹੈ, ਤਾਂ ਹੇਠਾਂ ਦਿੱਤੇ QR ਕੋਡ (ਕਾਲੀ ਅਤੇ ਚਿੱਟੇ ਚੈਕ) ਤੇ ਆਪਣਾ ਫੋਨ ਕੈਮਰਾ ਦੱਸੋ ਅਤੇ ਆਪਣੇ ਫੋਨ ਦੀ ਸਕ੍ਰੀਨ ਤੇ ਕਲਿਕ ਕਰੋ.",
    ro: "Dacă aveți un smartphone, îndreptați -vă camera de telefon către următorul cod QR (verificări alb -negru) și faceți clic pe el în ecranul telefonului.",
    ru: "Если у вас есть смартфон, укажите камеру телефона на следующем QR -коде (черно -белые проверки) и нажмите на него на экране вашего телефона.",
    sm: "Afai o iai sau Smartphone, faʻasino lau telefoni mea pueata i luga o le QR code (Black ma White Checks), ma kiliki i lau telefoni.",
    sr: "Ако имате паметни телефон, унесите своју телефонску камеру на следећем КР цоде (Црно-бели чекови) и кликните на њеним на екрану вашег телефона.",
    sd: "جيڪڏهن توهان وٽ هڪ اسمارٽ فون آهي، توهان جي فون ڪيمرا هيٺ ڏنل QR ڪوڊ تي اشارو ڪيو (ڪارو ۽ اڇو چيڪ)، ۽ توهان جي فون جي اسڪرين ۾ ڪلڪ ڪريو.",
    si: "ඔබට ස්මාර්ට් ජංගම දුරකතනයක් තිබේ නම්, ඔබේ දුරකථන කැමරාව පහත QR කේතයකින් (කළු සහ සුදු චෙක්පත්) පෙන්වා දෙන්න, ඔබේ දුරකථනයේ තිරයේ එය මත ක්ලික් කරන්න.",
    sk: "Ak máte smartfón, nasmerujte fotoaparát telefónu na nasledujúci QR kód (čiernobiele kontroly) a kliknite naň na obrazovke telefónu.",
    sl: "Če imate pametni telefon, pokažite kamero telefona na naslednjo QR kodo (črno -bele čeke) in ga kliknite na zaslonu telefona.",
    so: "Haddii aad leedahay taleefan casriga ah, tilmaan kaamirada taleefankaaga ee soosocda lambarka sirta ah ee QR (madow iyo cad), oo dhagsii dhinaca taleefankaaga.",
    es: "Si tiene un teléfono inteligente, apunte a la cámara de su teléfono al siguiente código QR (verificaciones en blanco y negro) y haga clic en él en la pantalla de su teléfono.",
    su: "Upami anjeun gaduh smartphone, nunjukkeun kaméra telepon anjeun dina kode qr ieu (cék hideung sareng bodas), teras klik dina layar telepon anjeun.",
    sw: "Ikiwa unayo smartphone, elekeza kamera yako ya simu kwenye nambari ifuatayo ya QR (cheki nyeusi na nyeupe), na ubonyeze kwenye skrini ya simu yako.",
    sv: "Om du har en smartphone, peka på din telefonkamera på följande QR -kod (svartvita kontroller) och klicka på den på telefonens skärm.",
    tl: "Kung mayroon kang isang smartphone, ituro ang iyong camera ng telepono sa sumusunod na QR code (itim at puting mga tseke), at i -click ito sa screen ng iyong telepono.",
    ta: "உங்களிடம் ஸ்மார்ட்போன் இருந்தால், உங்கள் தொலைபேசி கேமராவை பின்வரும் QR குறியீட்டில் (கருப்பு மற்றும் வெள்ளை காசோலைகள்) சுட்டிக்காட்டி, உங்கள் தொலைபேசியின் திரையில் அதைக் கிளிக் செய்க.",
    te: "మీకు స్మార్ట్‌ఫోన్ ఉంటే, మీ ఫోన్ కెమెరాను కింది QR కోడ్ (బ్లాక్ అండ్ వైట్ చెక్కులు) వద్ద సూచించండి మరియు మీ ఫోన్ స్క్రీన్‌లో దానిపై క్లిక్ చేయండి.",
    th: "หากคุณมีสมาร์ทโฟนให้ชี้กล้องโทรศัพท์ของคุณที่รหัส QR ต่อไปนี้ (เช็คขาวและขาว) และคลิกที่หน้าจอโทรศัพท์ของคุณ",
    tr: "Bir akıllı telefonunuz varsa, telefon kameranızı aşağıdaki QR koduna (siyah beyaz kontroller) yönlendirin ve telefonunuzun ekranına tıklayın.",
    uk: "Якщо у вас є смартфон, вкажіть свою телефонну камеру на наступний QR -код (чорно -білі чеки) та натисніть на неї на екрані телефону.",
    ur: "اگر آپ کے پاس اسمارٹ فون ہے تو ، اپنے فون کیمرا کو درج ذیل کیو آر کوڈ (سیاہ اور سفید چیک) پر نشاندہی کریں ، اور اپنے فون کی اسکرین میں اس پر کلک کریں۔",
    ug: "ئەگەر سىزدە ئەقلىي ئىقتىدارلىق يانفونىڭىز بولسا, تېلېفون كامېراسىنى تۆۋەندىكى QR كودىغا (قارا ۋە ئاق تەكشۈرۈش) غا توغرىلاپ, تېلېفوننىڭ ئېكرانىدا چېكىڭ.",
    uz: "Agar sizda smartfon bo'lsa, telefoningiz kamerasini quyidagi QR kodida ko'rsating va uni telefoningiz ekranida bosing.",
    vi: "Nếu bạn có điện thoại thông minh, hãy chỉ camera điện thoại của bạn vào mã QR sau (kiểm tra đen trắng) và nhấp vào nó trong màn hình điện thoại của bạn.",
