    sl: "Ta telefon postavite na kozarec, vrč ali lahko in usmerite ta rob telefona ⇧ na računalniku, tako da je mikrofon na vidnem pogledu na zvočnike, ki so običajno v tipkovnici. Pritisnite nadaljevanje.",
