    mr: "अचूक ध्वनी तयार करण्यासाठी, आम्हाला लाऊडस्पीकर कॅलिब्रेट करणे आवश्यक आहे. यासाठी कॅलिब्रेटेड मायक्रोफोन आवश्यक आहे. आपल्याकडे स्मार्टफोन (किंवा यूएसबी मायक्रोफोन) सुलभ आहे?\n",
    mo: "Pentru a produce sunete precise, trebuie să calibrăm difuzoarele. Acest lucru necesită un microfon calibrat. Aveți la îndemână un smartphone (sau microfon USB)?\n",
    mn: "Үнэн зөв дуу гаргахын тулд бид чанга яригчийг тохируулах хэрэгтэй. Энэ нь тохируулагдсан микрофон шаарддаг. Танд ухаалаг гар утас (эсвэл USB микрофон) гартай юу?\n",
    ne: "सही आवाज उत्पादन गर्न, हामीले लाउडस्पीकर्सलाई क्यालिब्रेट गर्न आवश्यक छ। यसको लागि क्यालिब्रेटेड माइक्रोफोन चाहिन्छ। के तपाइँसँग स्मार्टफोन (वा USB माइक्रोफोन) को उपयोगकर्ता छ?\n",
    no: "For å produsere nøyaktige lyder, må vi kalibrere høyttalerne. Dette krever en kalibrert mikrofon. Har du en smarttelefon (eller USB -mikrofon) praktisk?\n",
    yi: "צו פּראָדוצירן פּינטלעך סאָונדס, מיר דאַרפֿן צו קאַלאַברייט די הילכערס. דאָס ריקווייערז אַ קאַלאַברייטיד מיקראָפאָן. צי איר האָבן אַ סמאַרטפאָנע (אָדער וסב מיקראָפאָן) האַנטיק?\n",
    fa: "برای تولید صداهای دقیق ، باید بلندگوها را کالیبره کنیم. این به میکروفون کالیبره شده نیاز دارد. آیا تلفن هوشمند (یا میکروفون USB) مفید دارید؟\n",
    pl: "Aby uzyskać dokładne dźwięki, musimy kalibrować głośniki. Wymaga to skalibrowanego mikrofonu. Czy masz pod ręką smartfon (lub mikrofon USB)?\n",
    pt: "Para produzir sons precisos, precisamos calibrar os alto -falantes. Isso requer um microfone calibrado. Você tem um smartphone (ou microfone USB) à mão?\n",
