    so: "Si loo soo saaro dhawaqyo sax ah, waxaan u baahan nahay inaan sare u qaadno cod-bixiyaha. Tani waxay u baahan tahay makarafoon lagu dhejiyay. Ma haysaa taleefanka casriga ah (ama makarafoonka USB) wax gacanta ah?\n",
    es: "Para producir sonidos precisos, necesitamos calibrar los altavoces. Esto requiere un micrófono calibrado. ¿Tiene un teléfono inteligente (o micrófono USB) a mano?\n",
