    tl: "Upang makagawa ng tumpak na tunog, kailangan nating i -calibrate ang mga loudspeaker. Nangangailangan ito ng isang calibrated mikropono. Mayroon ka bang isang smartphone (o USB mikropono) na madaling gamitin?\n",
    ta: "துல்லியமான ஒலிகளை உருவாக்க, நாம் ஒலிபெருக்கிகளை அளவீடு செய்ய வேண்டும். இதற்கு அளவீடு செய்யப்பட்ட மைக்ரோஃபோன் தேவை. உங்களிடம் ஸ்மார்ட்போன் (அல்லது யூ.எஸ்.பி மைக்ரோஃபோன்) எளிதில் இருக்கிறதா?\n",
