    th: "ในการผลิตเสียงที่แม่นยำเราจำเป็นต้องปรับเทียบลำโพง สิ่งนี้ต้องใช้ไมโครโฟนที่สอบเทียบ คุณมีสมาร์ทโฟน (หรือไมโครโฟน USB) หรือไม่?\n",
    tr: "Doğru sesler üretmek için hoparlörleri kalibre etmemiz gerekir. Bu kalibre edilmiş bir mikrofon gerektirir. Bir akıllı telefonunuz (veya USB mikrofonunuz) kullanışlı mı?\n",
