    ug: "توغرا ئاۋاز چىقىرىش ئۈچۈن, قاتتىق ياڭراتقۇنى تەڭشەش كېرەك. بۇ تەڭشەش مىكروفونىنى تەلەپ قىلىدۇ. سىزدە ئەقلىي ئىقتىدارلىق تېلېفون (ياكى USB مىكروفونىڭىز بارمۇ) قولايلىقمۇ?\n",
