    ne: "हाम्रो सर्वेक्षणमा भाग लिनु भएकोमा धन्यवाद। नछोड। अगाडि बढ्नुहोस् ताकि हामी परिणामहरू बचत गर्न सक्दछौं र तपाईंको समाप्ति कोडको साथ प्रशस्ततामा फर्काउन सक्दछौं। धन्यवाद",
    no: "Takk for at du deltok i undersøkelsen vår. Ikke slutte. Hit fortsett slik at vi kan lagre resultatene og omdirigere deg tilbake til produktiv med fullføringskoden. Takk.",
    yi: "דאנק איר פֿאַר פּאַרטיסאַפּייטינג אין אונדזער יבערבליק. שווייג נישט. קלאַפּ גיינ ווייַטער אַזוי מיר קענען ראַטעווען די רעזולטאַטן און רידערעקט איר צוריק צו שעפעדיק מיט דיין קאַמפּלישאַן קאָד. אַ דאַנק.",
    fa: "با تشکر از شما برای شرکت در نظرسنجی ما. خارج نشو. HIT ادامه دهید تا بتوانیم نتایج را ذخیره کنیم و شما را با کد تکمیل خود به پرکار برگردانیم. با تشکر.",
    pl: "Dziękujemy za udział w naszej ankiecie. Nie odchodź. Kliknij Przejdź, abyśmy mogli zapisać wyniki i przekierować Cię z powrotem do płodnego kodu ukończenia. Dzięki.",
    pt: "Obrigado por participar no nosso inquérito. Não saia. Prossiga de acertar para que possamos salvar os resultados e redirecioná -lo de volta ao prolífico com seu código de conclusão. Obrigado.",
    pa: "ਸਾਡੇ ਸਰਵੇਖਣ ਵਿਚ ਹਿੱਸਾ ਲੈਣ ਲਈ ਤੁਹਾਡਾ ਧੰਨਵਾਦ. ਨਾ ਛੱਡੋ. ਹਿੱਟ ਜਾਓ ਤਾਂ ਜੋ ਅਸੀਂ ਨਤੀਜਿਆਂ ਨੂੰ ਬਚਾ ਸਕੀਏ ਅਤੇ ਆਪਣੇ ਪੂਰਵ ਸੰਮੇਲਨ ਦੇ ਨਾਲ ਤੁਹਾਨੂੰ ਵਾਪਸ ਜਾਣ ਲਈ ਰੀਡਾਇਰੈਕਟ ਕਰ ਸਕੀਏ. ਧੰਨਵਾਦ.",
    ro: "Vă mulțumim că ați participat la sondajul nostru. Nu renunta. Apăsați continuu, astfel încât să putem salva rezultatele și să vă redirecționați înapoi la Prolific cu codul dvs. de finalizare. Mulțumiri.",
    ru: "Спасибо за участие в нашем опросе. Не уходи. Нажмите, чтобы мы могли сохранить результаты и перенаправить вас обратно на плодовитую с помощью вашего кода завершения. Спасибо.",
    sm: "Faʻafetai mo le auai i la matou suʻesuʻega. Aua le fiu. O le taia o le faʻagasolo ina ia mafai ona matou sefeina le iʻuga ma le toe faʻaleleia o oe e toe foʻi mai i lau faʻasologa maeʻa. Fa'afetai.",
    sr: "Хвала вам што сте учествовали у нашем истраживању. Не одустају. Ударите поступно, тако да можемо да сачувамо резултате и преусмеримо да вас вратимо на плодним кодом завршетка. Хвала.",
    sd: "اسان جي سروي ۾ حصو وٺڻ لاء مهرباني. نه ڇڏيو. اڳتي وڌو ته اسان نتيجا محفوظ ڪري سگهون ٿا ۽ توهان کي پنهنجي مڪمل ٿيڻ واري ڪوڊ سان توهان کي واپس منتقل ڪري سگهو ٿا. مهرباني.",
    si: "අපගේ සමීක්ෂණයට සහභාගී වීම ගැන ස්තූතියි. ඉවත්ව නොයන්න. ඉදිරියට යන්න එවිට අපට ප්රති results ල සුරැකීමට සහ ඔබේ සම්පූර්ණ කිරීමේ කේතය සමඟ ඔබව නැවත හරවා යැවිය හැකිය. ස්තූතියි.",
    sk: "Ďakujeme, že ste sa zúčastnili nášho prieskumu. Nekonči. Hit Proting, aby sme mohli uložiť výsledky a presmerovať vás späť na plodný kód dokončenia. Vďaka.",
    sl: "Hvala, ker ste sodelovali v naši raziskavi. Ne odnehaj. Pritisnite nadaljevanje, da bomo lahko prihranili rezultate in vas preusmerili nazaj na plodno s kodo za dokončanje. Hvala.",
    so: "Waad ku mahadsantahay kaqaybgalka sahankayaga. Ha joojin. Hit sii wad si aan u badbaadin karno natiijooyinka oo dib kuugu soo celin karno adiga oo dib ugu soo celinaya code-ka dhameystirka. Mahadsanid.",
    es: "Gracias por participar en nuestra encuesta. No renuncies. Presione proceder para que podamos guardar los resultados y redirigirlo de nuevo a Prolific con su código de finalización. Gracias.",
