    ta: "எங்கள் கணக்கெடுப்பில் பங்கேற்றதற்கு நன்றி. வெளியேற வேண்டாம். தொடரைத் தாக்கவும், எனவே நாங்கள் முடிவுகளைச் சேமிக்க முடியும் மற்றும் உங்கள் நிறைவு குறியீட்டைக் கொண்டு உங்களை மீண்டும் திருப்பி விடலாம். நன்றி.",
    te: "మా సర్వేలో పాల్గొన్నందుకు ధన్యవాదాలు. నిష్క్రమించవద్దు. కొనసాగండి, తద్వారా మేము ఫలితాలను సేవ్ చేయవచ్చు మరియు మీ పూర్తి కోడ్‌తో మిమ్మల్ని తిరిగి మార్చవచ్చు. ధన్యవాదాలు.",
    th: "ขอบคุณสำหรับการเข้าร่วมในแบบสำรวจของเรา อย่าเลิก Hit ดำเนินการต่อเพื่อให้เราสามารถบันทึกผลลัพธ์และเปลี่ยนเส้นทางให้คุณกลับไปที่ความอุดมสมบูรณ์ด้วยรหัสเสร็จสิ้นของคุณ ขอบคุณ.",
    tr: "Anketimize katıldığınız için teşekkür ederiz. Çıkma. Sonuçları kaydedebilmemiz ve tamamlama kodunuzla sizi üretken hale getirebilmemiz için devam edin. Teşekkürler.",
    uk: "Дякуємо за участь у нашому опитуванні. Не йдуть. Натисніть, щоб ми могли зберегти результати та перенаправити вас до плодовитої з кодом завершення. Дякую.",
    ur: "ہمارے سروے میں حصہ لینے کے لئے آپ کا شکریہ۔ ہار مت مانو. آگے بڑھیں تاکہ ہم نتائج کو بچا سکیں اور آپ کو اپنے تکمیل کوڈ کے ذریعہ آپ کو واپس کرنے کے لئے واپس کردیں۔ شکریہ.",
    ug: "تەكشۈرۈشىمىزگە قاتناشقانلىقىڭىزغا رەھمەت. تاشلىماڭ. زەربە داۋاملاشتۇردى, شۇڭا بىز نەتىجىنى تېجەپ قالالايمىز ۋە تاماملىيالايمىز. رەھمەت.",
    uz: "Bizning so'rovimizda ishtirok etganingiz uchun tashakkur. Chiqmang. Biz natijalarni tejashimiz va to'ldirilgan kodingiz bilan qayta yo'naltirishni boshlaymiz. Rahmat.",
    vi: "Cảm ơn vì đã tham gia vào cuộc điều tra của chúng tôi. Không bỏ cuộc. Nhấn tiến hành để chúng tôi có thể lưu kết quả và chuyển hướng bạn trở lại với mã hoàn thành của bạn. Cảm ơn.",
