    kn: "Loading...",
    kk: "❌ Кешіріңіз, ең соңғы сол және оң жақ өлшемдер сәйкес келмейді. Біз қайталап көре аламыз ба? Бір көзді жабыңыз. Крест шаштарына назар аударыңыз және көздің бұрышынан жыпылықтайтын нүктеге назар аударыңыз. Нүктені солға және оңға сырғытыңыз, ол сіздің соқырларыңыздың ішіне жоғалғанша, содан кейін қайтаруды бастаңыз. Көзді екі көзді сынап көру кезінде көру қашықтықыңызды сақтаңыз.",
