    ta: "துல்லியமான ஒலியை உருவாக்க, சோதனை ஒலிபெருக்கிகளை அளவீடு செய்ய வேண்டும். இதற்கு இணையத்துடன் இணைக்கப்பட்ட ஸ்மார்ட்போன் தேவைப்படுகிறது. உங்களிடம் ஒரு எளிது இருக்கிறதா?\n",
    te: "ఖచ్చితమైన ధ్వనిని ఉత్పత్తి చేయడానికి, ప్రయోగం లౌడ్‌స్పీకర్లను క్రమాంకనం చేయాలి. దీనికి ఇంటర్నెట్‌కు కనెక్ట్ చేయబడిన స్మార్ట్‌ఫోన్ అవసరం. మీకు ఒక సులభ ఉందా?\n",
    th: "ในการสร้างเสียงที่แม่นยำการทดลองจำเป็นต้องปรับเทียบลำโพง ต้องใช้สมาร์ทโฟนที่เชื่อมต่อกับอินเทอร์เน็ต คุณมีประโยชน์หรือไม่?\n",
    tr: "Doğru ses üretmek için deneyin hoparlörleri kalibre etmesi gerekir. Bu, İnternet'e bağlı bir akıllı telefon gerektirir. Bir kullanışlı var mı?\n",
    uk: "Для видання точного звуку експеримент повинен калібрувати гучномовці. Для цього потрібен смартфон, підключений до Інтернету. У вас є одна зручна?\n",
    ur: "درست آواز پیدا کرنے کے ل the ، تجربے کو لاؤڈ اسپیکر کو کیلیبریٹ کرنے کی ضرورت ہے۔ اس کے لئے انٹرنیٹ سے منسلک اسمارٹ فون کی ضرورت ہے۔ کیا آپ کے پاس ایک آسان ہے؟\n",
    ug: "توغرا ئاۋاز ھاسىل قىلىش, تەجرىبە ياڭراتقۇنى تەڭشەش كېرەك. بۇ تورغا ئۇلانغان چۈشلۈك تېلېفون تەلەپ قىلىدۇ. بىر قولىڭىز بارمۇ?\n",
    uz: "To'g'ri tovushni ishlab chiqarish uchun tajriba Karnaylarni qayta to'ldirishi kerak. Bu Internetga ulangan smartfonni talab qiladi. Sizda bitta qulaymi?\n",
    vi: "Để tạo ra âm thanh chính xác, thí nghiệm cần hiệu chỉnh loa. Điều này đòi hỏi một điện thoại thông minh được kết nối với Internet. Bạn có một tiện dụng không?\n",
    zu: "Ukuze ukhiqize umsindo onembile, ukuhlolwa kudinga ukulinganisa amazwi aphezulu. Lokhu kudinga i-smartphone exhunywe kwi-Intanethi. Ingabe unayo i-munye?\n",
