      "The letter size and spacing vary from big and easy down to tiny and hard. You can't get much more than two-thirds right, so relax. Think of it as a guessing game, and just get as many as you can. You'll hear a beep whenever you're right.",
    af: "Die grootte van die letters en die afstand tussen die letters wissel tussen die groot en die longe tot die klein en swaar of onmoontlike. U kan nie veel meer as twee -derdes kry nie, so ontspan. Dink daaraan as raai en kry net soveel as moontlik. U sal 'n klanksein hoor as u reg is.",
