    ar: "إذا كانت هذه الشاشة تتجمد ، فيرجى إعادة الاتصال عن طريق توجيه كاميرا الهاتف الذكي على رمز الاستجابة السريعة على شاشة الكمبيوتر الخاصة بك. عندما يظهر رابط ، المس بإصبعك.",
