    de: "Bereit, ein paar Wörter zu lesen? Während Sie direkt in die Mitte der Cross -Haare schauen, drücken Sie bitte die Raumleiste.",
    el: "Είστε έτοιμοι να διαβάσετε μερικές λέξεις; Ενώ κοιτάζετε απευθείας στο κέντρο των σταυροειδών τριχών, πατήστε το Space Bar.",
    gu: "કેટલાક શબ્દો વાંચવા માટે તૈયાર છો? સીધા ક્રોસ વાળની ​​મધ્યમાં જોતી વખતે, કૃપા કરીને સ્પેસ બાર દબાવો.",
    he: "מוכנים לקרוא כמה מילים? תוך כדי התבוננות ישירות במרכז שערות הצלב, אנא לחץ על מוט החלל.",
    hi: "कुछ शब्द पढ़ने के लिए तैयार हैं? क्रॉस हेयर के केंद्र में सीधे देखते हुए, कृपया स्पेस बार दबाएं।",
    hu: "Készen áll néhány szó elolvasására? Miközben közvetlenül a keresztszőrzet közepére nézi, kérjük, nyomja meg az űrrúdot.",
