    ga: "Réidh le roinnt focal a léamh? Agus tú ag féachaint go díreach i lár na ribí tras, brúigh an barra spáis.",
    it: "Pronto a leggere alcune parole? Mentre guardi direttamente al centro dei capelli incrociati, premi la barra spaziale.",
