    kn: "ಕೆಲವು ಪದಗಳನ್ನು ಓದಲು ಸಿದ್ಧರಿದ್ದೀರಾ? ಅಡ್ಡ ಕೂದಲಿನ ಮಧ್ಯಭಾಗವನ್ನು ನೇರವಾಗಿ ನೋಡುವಾಗ, ದಯವಿಟ್ಟು ಸ್ಪೇಸ್ ಬಾರ್ ಒತ್ತಿರಿ.",
    kk: "Кейбір сөздерді оқуға дайынсыз ба? Тікелей кросс-түшкелердің ортасына қарай отырып, бос орынды басыңыз.",
    ky: "Бир нече сөздөрдү окууга даярсызбы? Айдоо түктөрүнүн борборунда түздөн-түз карап жатканда космостук тилкесин басыңыз.",
    ko: "단어를 읽을 준비가 되셨습니까? 크로스 털의 중앙을 직접 보면서 우주 막대를 누릅니다.",
