    si: "වචන කිහිපයක් කියවීමට සූදානම්ද? කුරුස හිසකෙස් කේන්ද්රයේ කෙලින්ම බලන විට, කරුණාකර අභ්යවකාශ තීරුව ඔබන්න.",
