    ta: "வாக்கியத்தின் புத்திசாலித்தனம் எளிதானது முதல் கடினமான அல்லது சாத்தியமற்றது வரை மாறுபடும். மூன்றில் இரண்டு பங்கிற்கு மேல் நீங்கள் பெற முடியாது, எனவே ஓய்வெடுங்கள். இதை ஒரு யூகிக்கும் விளையாட்டாக நினைத்துப் பாருங்கள், உங்களால் முடிந்தவரை பலவற்றைப் பெறுங்கள். நீங்கள் சரியாக இருக்கும்போதெல்லாம் ஒரு பீப்பைக் கேட்பீர்கள்.",
    te: "వాక్యం యొక్క తెలివితేటలు సులభంగా నుండి కఠినమైన లేదా అసాధ్యం వరకు మారుతూ ఉంటాయి. మీరు మూడింట రెండు వంతుల కంటే ఎక్కువ పొందలేరు, కాబట్టి విశ్రాంతి తీసుకోండి. దీన్ని game హించే ఆటగా భావించండి మరియు మీకు వీలైనన్ని ఎక్కువ పొందండి. మీరు సరైనప్పుడల్లా బీప్ వింటారు.",
    th: "ความเข้าใจของประโยคจะแตกต่างกันไปจากง่ายไปจนถึงยากหรือเป็นไปไม่ได้ คุณไม่สามารถได้รับมากกว่าสองในสามที่ถูกต้องดังนั้นผ่อนคลาย คิดว่ามันเป็นเกมที่คาดเดาและได้รับมากที่สุดเท่าที่จะทำได้ คุณจะได้ยินเสียงบี๊บเมื่อใดก็ตามที่คุณพูดถูก",
    tr: "Cümlenin anlaşılabilirliği kolaydan zor veya imkansıza kadar değişecektir. Üçte ikisinden fazlasını doğru alamazsınız, bu yüzden rahatlayın. Bunu bir tahmin oyunu olarak düşünün ve olabildiğince çok alın. Haklı olduğunuzda bir bip sesi duyacaksınız.",
    uk: "Розбірливість речення буде різною від легкої до важкої чи неможливої. Ви не можете отримати набагато більше, ніж дві третини правильно, тому розслабтеся. Подумайте про це як про здогадку, і просто отримайте стільки, скільки зможете. Ви почуєте звуковий сигнал, коли ви маєте рацію.",
