    ug: "جۈملىنىڭ چۈشىنىلىشى ئاسان ياكى مۇمكىن بولمايدىغان ئاسان ياكى مۇمكىن ئەمەس. ئىككىدىن ئارتۇق ئىككىدىن ئارتۇق توغرا بولالمايسىز, شۇڭا ئارام ئېلىڭ. ئۇنى پەرەز قىلىش ئويۇنى دەپ ئويلاڭ, ئىمكانقەدەر كۆپ چىقىڭ. توغرا بولغاندا ئاۋازنى ئاڭلايسىز.",
