    km: "បញ្ជីខាងក្រោមបង្ហាញពីលទ្ធភាពទាំងអស់សម្រាប់ពាក្យនីមួយៗក្នុងប្រយោគ។ រាយការណ៍ប្រយោគឬការទស្សន៍ទាយដ៏ល្អបំផុតរបស់អ្នកដោយចុចលើពាក្យដែលអ្នកបាន heard ។",
