    kk: "Төмендегі тізімдер сөйлемдегі әр сөздің барлық мүмкіндіктерін көрсетеді. Сіз естіген сөздерді басу арқылы сөйлемді немесе ең жақсы болжамыңызды хабарлаңыз.",
