    lo: "ບັນຊີລາຍຊື່ຂ້າງລຸ່ມນີ້ສະແດງໃຫ້ເຫັນຄວາມເປັນໄປໄດ້ທັງຫມົດສໍາລັບແຕ່ລະຄໍາໃນປະໂຫຍກ. ລາຍງານປະໂຫຍກ, ຫຼືການຄາດເດົາທີ່ດີທີ່ສຸດຂອງທ່ານ, ໂດຍການກົດຄໍາທີ່ທ່ານໄດ້ຍິນ.",
