    hy: "Բարեւ Ձեզ. Համոզվեք, որ ձայնը միացված է այս համակարգչում `կտտացնելով« Ձայն ազդանշանը »կոճակը: Ի դեպ, դուք կտեսնեք այդպիսի ձայնային ազդանշան ամեն անգամ, երբ փորձարկման տարբերակը անցնեք:",
