    eu: 'Kaixo. Ziurtatu soinua ordenagailu honetan aktibatuta dagoela "Soinu seinalean" botoian klik eginez. Bide batez, horrelako soinu seinale bat entzungo duzu probaren bertsioa gainditzen duzun bakoitzean.',
    bn: 'হ্যালো. "সাউন্ড সিগন্যাল" বোতামটি ক্লিক করে এই কম্পিউটারে শব্দটি চালু আছে তা নিশ্চিত করুন। যাইহোক, আপনি প্রতিবার পরীক্ষার সংস্করণটি পাস করার সময় এই জাতীয় শব্দ সংকেত শুনতে পাবেন।',
    bg: "Здравейте. Уверете се, че звукът е включен на този компютър, като щракнете върху бутона „Sound Signal“. Между другото, ще чуете такъв звуков сигнал всеки път, когато преминете тестовата версия.",
    my: 'မင်္ဂလာပါ။ "အသံ signal" ခလုတ်ကိုနှိပ်ခြင်းအားဖြင့်ဤကွန်ပျူတာပေါ်တွင်အသံဖွင့်ထားကြောင်းသေချာပါစေ။ စကားမစပ်, သင်သည်စမ်းသပ်မှုဗားရှင်းကိုဖြတ်သန်းတိုင်းအချိန်တိုင်းဤသို့သောအသံအချက်ပြမှုကိုကြားလိမ့်မည်။',
    be: 'Добры дзень. Пераканайцеся, што гук уключаны на гэтым кампутары, націснуўшы кнопку "Гукавы сігнал". Дарэчы, вы пачуеце такі гукавы сігнал кожны раз, калі вы пройдзеце тэставую версію.',
    km: 'សួស្តី ត្រូវប្រាកដថាសំឡេងត្រូវបានបើកនៅលើកុំព្យូទ័រនេះដោយចុចប៊ូតុង "សញ្ញាសំលេង" ។ ដោយវិធីនេះអ្នកនឹងលឺសំលេងបែបនេះរាល់ពេលដែលអ្នកឆ្លងកាត់កំណែសាកល្បង។',
    ca: 'Hola. Assegureu -vos que el so estigui activat en aquest ordinador fent clic al botó "Senyal de so". Per cert, sentireu un senyal de so cada vegada que passeu la versió de prova.',
