    cs: "Ahoj. Ujistěte se, že zvuk je zapnutý na tomto počítači kliknutím na tlačítko „Zvukový signál“. Mimochodem, uslyšíte takový zvukový signál pokaždé, když projdete testovací verzí.",
    da: 'Hej. Sørg for, at lyden er tændt på denne computer ved at klikke på knappen "lydsignal". For øvrig vil du høre et sådant lydsignal, hver gang du passerer testversionen.',
    nl: 'Hallo. Zorg ervoor dat het geluid op deze computer wordt ingeschakeld door op de knop "Geluidssignaal" te klikken. Trouwens, je hoort zo\'n geluidssignaal elke keer dat je de testversie passeert.',
